        user1: 'Angus',
        user2: 'Josh',
        url: ''
    }, 
    {
        user1: 'Angus2',
        user2: 'Josh2',
        url: ''
    }])


    return (
        <div>
            {group.map(users => (
                <TinderCard>
                    <div style={{backgroundColor: "orange"}} className="card">
                        <h3>{users.name}</h3>
                    </div>
                </TinderCard>
            ))}



        </div>
    )
}

